import React from "react";
import "./index.css";
import data from "./data.js";
import Review from "./components/Review";
import ReviewSummary from "./components/ReviewSummary";
import { Routes, Route } from "react-router-dom";
import Product from "./components/Product";
import Spin from "./components/Spin";

function App() {
  const reviewData = data.map((item) => {
    return <Review key={item.id} item={item} />;
  });
  return (
    <div>
      <Routes>
        <Route path="/" element={reviewData} />
        <Route
          path="reviewSummary"
          element={
            <ReviewSummary
              rectangle={data[0].rectangle}
              coloredStar={data[0].vector}
              whiteStar={data[0].vector2}
              img={data[0].imgUrl}
            />
          }
        />
        <Route
          path="product"
          element={
            <Product
              img={data[0].rectangle}
              coloredStar={data[0].vector}
              whiteStar={data[0].vector2}
            />
          }
        />

        <Route path="spin" element={<Spin />} />
      </Routes>
    </div>
  );
}

export default App;
